import Vue from 'vue'
import VueRouter from 'vue-router'
import StreamCheck from '../components/StreamCheck.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'StreamCheck',
    component: StreamCheck
  },
  // 捕获所有非api开头的未匹配路由
  {
    path: '/(?!api).*',
    redirect: '/'
  }
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
